import Register from '../components/BooksContainer/BooksContainer';
import Login from '../components/Login/Login';

const Home = () => {
    return <div className="home">
        <Navbar />
        <div className="homeRight">
            <Sidebar />
            <div className="homeContent">
                <SearchSort />
                <BooksContainer />
            </div>
        </div>
    </div>;
};

export default Home;
